import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Main.css';
import './icons/Icon.css'
import { ReactComponent as SquarePlusIcon } from './icons/square_plus.svg';
import ProfileWindow from './DialogWindows/ProfileWindow';
import NotificationsWindow from './DialogWindows/NotificationsWindow';
import SearchWindow from './DialogWindows/SearchWindow';


const Header = () => {
    return (
        <header className='header'>
            <div className='center-setter'>
                <div className='header-element'>
                    <div className='site-icon'>
                        <label>NovelSite</label>
                    </div>
                </div>
                <div className='header-element'>
                    <SearchWindow></SearchWindow>
                </div>
                <div className='header-element'>
                    <div className='horizontal-container'>
                        <SquarePlusIcon className='icon icon-color'></SquarePlusIcon>
                        <NotificationsWindow></NotificationsWindow>
                        <ProfileWindow></ProfileWindow>
                    </div>
                </div>
            </div>
        </header>
    )
}

export default Header;
